const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p><button class="badge-blue">ENTERPRISE PLANS ONLY</button></p>
    <h2 {...{
      "id": "updating-user-information"
    }}>{`Updating User Information`}</h2>
    <p>{`Organization admins can update the name, email address, user name, role, and team assignment for any user in their organization. Team admins can update that information for users on their team. If you invite a user via email, you will need to edit their concurrency limit and other account details after they have accepted your invitation and created an account.`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
        <img src={useBaseUrl('img/team-mgmt/team-mgmt-nav.jpg')} alt="Team management navigation" width="400" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`Users`}</strong>{` tab, click the user name of the user whose information you want to edit.`}</p>
        <img src={useBaseUrl('img/team-mgmt/users-list-username.jpg')} alt="User details" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`User Details`}</strong>{` page, in the `}<strong parentName="p">{`User Information`}</strong>{` section, make the necessary changes and then click `}<strong parentName="p">{`Update`}</strong>{`.`}</p>
        <img src={useBaseUrl('img/team-mgmt/user-details-user-info.jpg')} alt="User details" />
      </li>
    </ol>
    <h2 {...{
      "id": "filtering-users"
    }}>{`Filtering Users`}</h2>
    <p>{`Sauce Labs offers several options for filtering your list of users. To apply one or more of the available filters:`}</p>
    <ol>
      <li parentName="ol">{`In Sauce Labs, click `}<strong parentName="li">{`Account`}</strong>{` and then click `}<strong parentName="li">{`Team Management`}</strong>{`.`}</li>
      <li parentName="ol">{`On the `}<strong parentName="li">{`Users`}</strong>{` tab, select the checkboxes of the filters you want to apply. The user list will update accordingly.`}</li>
    </ol>
    <h3 {...{
      "id": "general-filters"
    }}>{`General Filters`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Filter`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Org Admin Options`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Active`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Active user`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Deactivate`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Inactive`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The user has been deactivated by the organization admin`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Reactivate`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Pending`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`The user has been invited via email but has not yet confirmed their invite, or the user was added manually and has not verified their email address`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Deactivate`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "team-filters"
    }}>{`Team Filters`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Filter`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Team name`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Filters by team`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "changing-a-users-role"
    }}>{`Changing a User's Role`}</h2>
    <p><strong parentName="p">{`NOTE:`}</strong>{` Only an organization admin can change a user’s role.`}</p>
    <p>{`You can change a user’s role on the `}<strong parentName="p">{`Organization Management`}</strong>{` page and also on the `}<strong parentName="p">{`User Details`}</strong>{` page.`}</p>
    <h3 {...{
      "id": "changing-a-users-role---organization-management"
    }}>{`Changing a User’s Role - Organization Management`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`Users`}</strong>{` tab, select the checkbox of the user you want to deactivate.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Above the list of users, in the `}<strong parentName="p">{`Action`}</strong>{` dropdown, click `}<strong parentName="p">{`Assign Role`}</strong>{` and then click the new role.`}</p>
        <img src={useBaseUrl('img/team-mgmt/change-role-org-mgmt.jpg')} alt="Change a user's role" />
      </li>
    </ol>
    <h3 {...{
      "id": "changing-a-users-role---user-details"
    }}>{`Changing a User’s Role - User Details`}</h3>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`Users`}</strong>{` tab, click the user name of the user whose role you want to change.`}</p>
        <img src={useBaseUrl('img/team-mgmt/users-list-username.jpg')} alt="Users list" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`User Details`}</strong>{` page, in the `}<strong parentName="p">{`User Information`}</strong>{` section, click the `}<strong parentName="p">{`Org. Role`}</strong>{` dropdown and then click the new role.`}</p>
        <img src={useBaseUrl('img/team-mgmt/change-role-user-details.jpg')} alt="Change a user's role" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`Click `}<strong parentName="p">{`Update`}</strong>{`.`}</p>
      </li>
    </ol>
    <h2 {...{
      "id": "regenerating-access-keys"
    }}>{`Regenerating Access Keys`}</h2>
    <p>{`You can regenerate a user's access key on the `}<strong parentName="p">{`Organization Management`}</strong>{` page.`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`In Sauce Labs, click `}<strong parentName="p">{`Account`}</strong>{` and then click `}<strong parentName="p">{`Team Management`}</strong>{`.`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`Users`}</strong>{` tab, click the user name of the user whose access key you want to regenerate.`}</p>
        <img src={useBaseUrl('img/team-mgmt/users-list-username.jpg')} alt="Users list" />
      </li>
      <li parentName="ol">
        <p parentName="li">{`On the `}<strong parentName="p">{`User Details`}</strong>{` page, in the `}<strong parentName="p">{`Access Key`}</strong>{` section, click `}<strong parentName="p">{`Regenerate Access Key`}</strong>{`.`}</p>
        <img src={useBaseUrl('img/team-mgmt/user-details-access-key.jpg')} alt="User Details - Access Key" />
      </li>
    </ol>
    <p><strong parentName="p">{`NOTE:`}</strong>{` Regenerating your access key will update the access key throughout your configuration. Commands containing your old access key will fail.`}</p>
    <h2 {...{
      "id": "user-roles"
    }}>{`User Roles`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Role`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Permissions`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Organization Admin`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><ul><li>{`Create and delete teams, and move teams within an organization`}</li><li>{`Manage Organization Settings`}</li><li>{`Manage users across the organization:`}<ul><li>{`Add and deactivate users`}</li><li>{`Reset user passwords`}</li><li>{`Change email addresses and names`}</li><li>{`Assign user roles`}</li><li>{`View user activity`}</li></ul></li><li>{`Set concurrency allocation for teams`}</li><li>{`Create Sauce Connect Proxy tunnels for users across the organization to share, or limit access to only other organization admins`}</li><li>{`View all jobs in the organization`}</li></ul></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Team Admin`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><ul><li>{`Only a user assigned to a team can become a team admin`}</li><li>{`Manage the team and users on the team`}</li><li>{`View team usage and users assigned to the team`}</li><li>{`View the shared tunnels and non-shared tunnels created by team members`}</li><li>{`Manage users on the team:`}<ul><li>{`Reset user passwords`}</li><li>{`Change email addresses and names`}</li><li>{`Move users between their team and the list of users who are not assigned to any team`}</li><li>{`View user activity`}</li></ul></li><li>{`View jobs that were run by team members`}</li><li>{`View jobs that were run by members of other teams`}</li></ul></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Team Member`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><ul><li>{`Edit personal information such as name, password, and email address`}</li><li>{`View jobs that were run by other team members`}</li><li>{`View jobs that were run by members of other teams in the organization`}</li><li>{`Create Sauce Connect Proxy tunnels for individual use or to be shared with other team members`}</li></ul></td>
        </tr>
      </tbody>
    </table>
    <p><strong parentName="p">{`NOTE:`}</strong>{` In every organization, multiple organization admins and/or team admins can exist. However, users can only be part of one organization.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
